import React from 'react';
import '../style/Browsing.css';

export default class ImageCard extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            title: props.title,
            value: props.value,
            content: props.content,
            base64Image: props.image,
        };
    }

    render() {
        return (
            <section className='image-card'>
                {this.state.base64Image && (
                    <img src={this.state.base64Image} className='image-preview' alt='3D Model' />
                )}
                <div className='model-title-container'>
                    <span className='model-title'>{this.state.title}</span>
                </div>
                <div className='card-details'>
                    <h4 className='current-bid'>Current Bid ${this.state.value}</h4>
                    <span className='card-content'>{this.state.content}</span>
                </div>
            </section>
        );
    }
}
